import React, { FC } from 'react';
import { Type } from 'typescript';

interface IContentEditableProps extends React.ComponentPropsWithRef {
  component?: keyof JSX.IntrinsicElements;
};

const ContentEditable = <T extends React.ElementType,>({ component: Component = 'div', ...other }: IContentEditableProps & React.ComponentProps<T>) => {

  return (
    <Component
      contentEditable
      {...other}
    />
  )
};

export default ContentEditable;
